import React from "react";
import './App.css';


function Header() {


  return (
    <div className="App-header">
        <a href="http://hjydomi.duckdns.org:1139">
          <img src={ require('../../img/dm_logo_b.png') } alt="로고"/>
        </a>
        <p>아라ㅏ랄라라ㅏ랄라라라라ㅏㅏㅏ</p>
        <a className="App-link" href="https://naver.com">
          리액트 처음부터 공부할 생각하면 아찔하군요..
        </a>
        
    </div>
  );
}

export default Header;
